[{"location":"example/#Package-Imports","page":"Example","title":"Package Imports","text":"","category":"section"},{"location":"example/#Mass-Spring-Damper-Example","page":"Example","title":"Mass - Spring - Damper Example","text":"","category":"section"},{"location":"example/","page":"Example","title":"Example","text":"using SystemBondGraphs\nusing ModelingToolkit: inputs\nusing OrdinaryDiffEq\nusing CairoMakie\nusing Latexify\n\nset_theme!(theme_latexfonts())","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"Create the time variable and the empty bond graph:","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"@variables t\nbg = BondGraph(t)","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"Elements in the bond graph are added with their appropriate add function and assigned a unique name in the bond graph:","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"add_R!(bg, :R)\nadd_C!(bg, :C)\nadd_I!(bg, :I)\nadd_Se!(bg, :Se)","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"Next, the 1-Junction is added:","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"add_1J!(bg, :J1_1)","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"The edges are connected with the add_bond! function which modifies the bond graph to have a power bond connecting the nodes. The function is takes the source and sink edge for the power bond. ","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"add_bond!(bg, :J1_1, :R, :e1)\nadd_bond!(bg, :J1_1, :C, :e2)\nadd_bond!(bg, :J1_1, :I, :e3)\nadd_bond!(bg, :Se, :J1_1, :e4)","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"The system of equations is equation from the bond graph with the generate_model function and then simplified with structural_simplify from ModelingToolkit.jl:","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"sys = generate_model(bg)\nsys, _ = structural_simplify(sys, (inputs(sys), []))","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"To simulate the system, the solution requires inital conditions, parameters, and timespan to be set. See DifferentialEquations.jl for more information on the methods for solving the ODESystem.","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"u0 = [\n    bg[:C].model.q => 10.0,\n    bg[:I].model.p => -1.0\n]\nps = [\n    bg[:R].model.R => 1.0,\n    bg[:C].model.C => 0.01,\n    bg[:I].model.I => 1.0,\n    bg[:Se].model.Se => 0.0\n    ]\ntspan = (0.0, 10.0)","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"Finally, solving and plotting the solution gives:","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"prob = ODEProblem(sys, u0, tspan, ps)\nsol = solve(prob, Tsit5())\nf, ax, p = CairoMakie.plot(sol,  axis=(xlabel=\"Time (t)\", ))\nsave(\"msd.png\", f) # hide","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"(Image: Mass Spring Damper Image)","category":"page"},{"location":"","page":"Home","title":"Home","text":"CurrentModule = SystemBondGraphs","category":"page"},{"location":"#SystemBondGraphs","page":"Home","title":"SystemBondGraphs","text":"","category":"section"},{"location":"#Installation","page":"Home","title":"Installation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"To install SystemBondGraphs.jl in Julia, use the Julia package manager:","category":"page"},{"location":"","page":"Home","title":"Home","text":"] https://github.com/TRACER-LULab/SystemBondGraphs.jl.git","category":"page"},{"location":"#Community-Guidelines","page":"Home","title":"Community Guidelines","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"To sustainably develop the package, we will use the established practices from the SciML community for guidlines:","category":"page"},{"location":"","page":"Home","title":"Home","text":"For any issues with or contributions, please open an issue in GitHub or a PR as appropriate.\nPlease refer to the   SciML ColPrac: Contributor's Guide on Collaborative Practices for Community Packages   for guidance on PRs, issues, and other matters relating to contributing.\nSee the SciML Style Guide for common coding practices and other style decisions.","category":"page"},{"location":"API/","page":"API","title":"API","text":"CurrentModule = SystemBondGraphs","category":"page"},{"location":"API/#API-Reference","page":"API","title":"API Reference","text":"","category":"section"},{"location":"API/","page":"API","title":"API","text":"Modules = [SystemBondGraphs]","category":"page"},{"location":"API/#SystemBondGraphs.BondGraph-Tuple{Num}","page":"API","title":"SystemBondGraphs.BondGraph","text":"Create an empty BondGraph to be populated during the analysis\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs._generate_model-Tuple{Any}","page":"API","title":"SystemBondGraphs._generate_model","text":"Traverse the BondGraph Structure to create an ODESystem\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_C!-NTuple{4, Any}","page":"API","title":"SystemBondGraphs.add_C!","text":"Create a Nonlinear C-Element with e = phi_c(e f q t ps). Setting Causality to true represents the elements being in derivative causality.\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_C!-Tuple{Any, Any}","page":"API","title":"SystemBondGraphs.add_C!","text":"Create a Linear C-Element for analysis. Setting Causality to true represents the elements being in derivative causality.\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_Ce!-Tuple{Any, Any}","page":"API","title":"SystemBondGraphs.add_Ce!","text":"Create a \"Linear\" Concentration-Element for analysis. Setting Causality to true represents the elements being in derivative causality.\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_Chemostat!-Tuple{Any, Any, Vector, Any}","page":"API","title":"SystemBondGraphs.add_Chemostat!","text":"Create a nonliner chemostat\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_Chemostat!-Tuple{Any, Any}","page":"API","title":"SystemBondGraphs.add_Chemostat!","text":"Create a linear chemostat\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_Flowstat!-Tuple{Any, Any, Vector, Any}","page":"API","title":"SystemBondGraphs.add_Flowstat!","text":"Create a nonlinear Flowstat\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_Flowstat!-Tuple{Any, Any}","page":"API","title":"SystemBondGraphs.add_Flowstat!","text":"Create a linear Flowstat\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_GY!-Tuple{Any, Any}","page":"API","title":"SystemBondGraphs.add_GY!","text":"Add a linear gyrator with modulus r, in element name in, out element name out, and named name.\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_I!-NTuple{4, Any}","page":"API","title":"SystemBondGraphs.add_I!","text":"Create a Nonlinear I-Element with f = phi_I(e f p t ps). Setting Causality to true represents the elements being in derivative causality.\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_I!-Tuple{Any, Any}","page":"API","title":"SystemBondGraphs.add_I!","text":"Create a Linear I-Element, setting the casuality to true signifies that the element is in derivative causality\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_M!-NTuple{4, Any}","page":"API","title":"SystemBondGraphs.add_M!","text":"Create a Nonlinear M-Element with p = phi_M(e f p q t ps). Setting Causality to true represents the elements being in derivative causality.\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_M!-Tuple{Any, Any}","page":"API","title":"SystemBondGraphs.add_M!","text":"Create a Linear M-element with causality being set to false. Derivative causality for M-elements is still under development.\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_MGY!-Tuple{Any, Any, Any}","page":"API","title":"SystemBondGraphs.add_MGY!","text":"Add a modulated gyrator with modulus r, in element name in, out element name out, and named name.\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_MTF!-Tuple{Any, Any, Any}","page":"API","title":"SystemBondGraphs.add_MTF!","text":"Add a modulated transformer with modulus m, in element name in, out element name out, and named name.\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_R!-NTuple{4, Any}","page":"API","title":"SystemBondGraphs.add_R!","text":"Create a nonlinear R-Element with Phi_r registered with modelingtoolkit.jl to prevent simplification through the nonlinear function. e = Phi_r(e f t ps). Params are for any parameters to the nonlinear function.\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_R!-Tuple{Any, Any}","page":"API","title":"SystemBondGraphs.add_R!","text":"Create a Linear R-Element for the bondgraph. Causality will always be false for an R-element since it does not have a \"preferred\" causality.\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_Re!-Tuple{Any, Any}","page":"API","title":"SystemBondGraphs.add_Re!","text":"Add a reaction component between species \"in\" and \"out\" with parameters R, T, r\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_Se!-Tuple{Any, Any, Vector, Any}","page":"API","title":"SystemBondGraphs.add_Se!","text":"Create a nonlinear effort input with e = S_e(e f iv params) with name\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_Se!-Tuple{Any, Any}","page":"API","title":"SystemBondGraphs.add_Se!","text":"Create a Symbolic/Constant Effort Input. Creates a system with parameters Se for the ODESystem.\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_Sf!-Tuple{Any, Any, Vector, Any}","page":"API","title":"SystemBondGraphs.add_Sf!","text":"Create a nonlinear flow input with f = S_f(e f iv params) with name\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_Sf!-Tuple{Any, Any}","page":"API","title":"SystemBondGraphs.add_Sf!","text":"Create a Symbolic/Constant Flow Input. Creates a system with parameters Sf for the ODESystem.\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.add_TF!-Tuple{Any, Any}","page":"API","title":"SystemBondGraphs.add_TF!","text":"Add a linear transformer with modulus m, in element name in, out element name out, and named name.\n\n\n\n\n\n","category":"method"},{"location":"API/#SystemBondGraphs.generate_model-Union{Tuple{MetaGraph{A, B, C, D, E, DATA, F, G}}, Tuple{G}, Tuple{F}, Tuple{DATA}, Tuple{E}, Tuple{D}, Tuple{C}, Tuple{B}, Tuple{A}} where {A, B, C, D, E, DATA<:SystemBondGraphs.ChemBondGraphData, F, G}","page":"API","title":"SystemBondGraphs.generate_model","text":"Generate an ODE System from the BondGraph Structure\n\n\n\n\n\n","category":"method"}]
